import ReactDOM from 'react-dom';
import Cards from "./Cards";
import "./index.css"
import Sdata from "./Sdata";

function ncard(val){
    console.log(val);
    return(
        <Cards 
        imgsrc= {val.imgscr}
        title= {val.title}
        sname= {val.sname}
        link= {val.links}
    />

    )

}
ReactDOM.render(
    <>
      <h1 className="heading_style">List of top 5 Netflix series in 2023</h1>


    Sdata.map(ncard);




    </>,


    document.getElementById("root")
);
